import React, { Component } from "react";
import axios from "axios";

const API_KEY = "afbd007707mshf3e391b451ab77cp1daa16jsn8b3241a3e170";

class GenerateStats extends Component {
  constructor() {
    super();
    this.state = {
      loading: true,
      stats: {},
      gamertag: "reubsz92",
      platform: "psn",
    };
  }

  componentDidMount() {
    const { gamertag, platform } = this.state;
    axios({
      method: "GET",
      url: `https://call-of-duty-modern-warfare.p.rapidapi.com/warzone/${gamertag}/${platform}`,
      headers: {
        "content-type": "application/octet-stream",
        "x-rapidapi-host": "call-of-duty-modern-warfare.p.rapidapi.com",
        "x-rapidapi-key": API_KEY,
        useQueryString: true,
      },
    })
      .then((response) => {
        console.log(response);
      })
      .then((data) => {
        console.log(data);
        this.setState({
          stats: data,
        });
      })
      .catch((error) => {
        console.log(error);
      });
    this.setState({ loading: false });
  }
  render() {
    if (this.state.loading) {
      return <div>Loading...</div>;
    } else
      return (
        <div>
          <p>Word</p>
        </div>
      );
  }
}

export default GenerateStats;
